import React, {useEffect, useState} from 'react';
import './Todo.css';
import {List, ListItemText, ListItem, ListItemAvatar, Avatar, ImageIcon} from '@material-ui/core'


function Todo({text}) {
    return (
        <List className="todo_list">
            <ListItem>
                <ListItemAvatar>
                </ListItemAvatar>
                    <ListItemText primary={text} secondary='Tomorrow'/>
            </ListItem>
        </List>
    )
}

export default Todo
